import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import {Weather} from './App';
import * as serviceWorker from './serviceWorker';

const GetWeather = () => {
  return (
    <div>
      <button onClick = { () => { 
        const fetchData = async () => {
        const response = await fetch(`https://api.openweathermap.org/data/2.5/forecast?q=stavropol,rus&appid=dfa9203fc19394100719613828a57682&units=metric&lang=ru`);
        const data = await response.json();
        return data;
  };

  console.log(fetchData());
}}> Получить погоду</button>
    </div>
);
}

ReactDOM.render(
  <React.StrictMode>
    <h1>График погоды: Простая линия</h1><br></br><br></br>
    <GetWeather />
    <Weather />
  </React.StrictMode>,
  document.getElementById('root')
);

serviceWorker.unregister();
